import React from 'react'
import './Signup.css'
import { useNavigate } from 'react-router-dom'
import { useDispatch, useSelector } from 'react-redux';
import { setType } from '../slices/authSlice';
export const Signup = () => {
    const navigate=useNavigate();
    const {type}=useSelector((state)=>state.auth);
    const dispatch=useDispatch();
  return (
    <div className="body flex ">
    
    
    <div className="div1 flex mx-auto" >
        <div>
        <img src="img/logo.png" alt="logo"/>
        </div>
        <br/>
        <div  className="div2 mt-[140px] flex flex-col gap-[20px] ">
            <h1 className="h1 font-extrabold text-[px] ">Sign In</h1>
            <div className="div5">
                <div>
                    <button className="hover" onClick={()=>{
                        dispatch(setType(true));
                    }} type="text"  placeholder="Patient">Patient</button>
                </div>
                <div>
                    <button className="hover" onClick={()=>{
                        dispatch(setType(false));
                    }}  type="text"  placeholder="Caretaker">Caretaker</button>
                </div>
            </div>
            <p><input className="input" type="text" name="name" placeholder="Email" required/></p>
            <p><input className="input" type="password" name="name" placeholder="password" required/></p>
            <p><input className="input" type="text" name="name" placeholder="Mobile Number" required/></p>
             <a  href="ForgotPassword">ForgotPassword?</a> 
            <br/>
            <div className="div3">
                <input className="hover" onClick={()=>navigate("/verifyEmail")} value="Sign In"/>
            </div>
            <br/>
            <br/>
            
        </div>
        <br/>
        <br/>
    </div>
</div>
  )
}
